import React from "react";
//import '../NavBar.css'

const NavBar = () => {
    return(
        <div className="navbar">
            <p>USER</p>

            <ul className="nav-menu">
                <li>APPLE</li>
                <li>SAMSUNG</li>
                <li>REDMI</li>
                <li>NOTHING</li>
            </ul>
            <div className="nav-login-cart">
                <button>Login</button>
            </div>

        </div>

    )
}
export default NavBar
